script: |
  super -f text -I q3743.spq | sort > q3743.out

inputs:
  - name: q3743.spq
    data: |
      SELECT - 46 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 + col1 + + col1 * + 87 * col0 BETWEEN + ( - + 82 ) AND + + col1 + col1;
  - name: tab0

outputs:
  - name: q3743.out
    data: |
      -46
      -46
      -46
